// @match        *://uat-dm.deepexi.com/*
// @match        *://dm.deepexi.com/*
// @match        *://uat-dsc.deepexi.com/*
// @match        *://uat-dd.deepexi.com/*
// @match        *://dsc.deepexi.com/*
// @match        *://dd.deepexi.com/*
// @match        *://dm-poc.deepexi.com/*
// @match        *://dxp-poc.deepexi.com/*
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/413184/Dx%20replacer.user.js
