// ==/UserScript==

(function () {

    console.log('======Dx replacer======')
    var $ = function (s) {
        return document.querySelector(s) || document.createElement('div')
    }

    var $$ = function (s) {
        return document.querySelectorAll(s)
    }
    var loaded = false
    var getLogoTextDD = function(){
          return $('.header-logo__title')
        }

    function rpdeep() {
      
      // 用户名
      var headerUsername2 = function(){
        return $('.el-header .user-operate')
      }
      loop(headerUsername2, function(dom){
        dom.innerHTML = ''
      })
      // 用户名
      var headerUsername = function(){
        return $('.head .el-dropdown')
      }
      loop(headerUsername, function(dom){
        dom.innerHTML = ''
      })
        // 隐藏头部供应链
        var getdsc = function(){
          return $$('.head .apps .app-item')
        }
        loop(getdsc, function(dom){
          if(dom && dom[2]){
               dom[2].innerHTML = ''
          }

        })

        var getdrMobileTech = function () {
            return $('.technology-publicity')
        }
        loop(getdrMobileTech, function (dom) {
            dom.innerHTML = ''
        })

        var getdom = function () {
            return $$('.weixin__list__content .weixin__list__desc')
        }

        loop(getdom, function (dom) {
            dom[2].innerText = dom[2].innerText.replace('滴普', '**')
            dom[6].innerText = dom[6].innerText.replace('滴普', '**')
        })

        var getLogoTextDR = function(){
          return $('.default-layout-header-logo h1')
        }
        var dxp = '数字化运营平台'
        var dm = '数字化运营平台'
        var title = '数字化运营平台'

        loop(getLogoTextDR , function (dom) {
            dom.innerText = dxp
        })

        var getLogoText2 = function(){
          return $('.head .name')
        }

        loop(getLogoText2, function (dom) {
            dom.innerText = dxp
            if(location.href.indexOf('dm.') > -1) dom.innerText = dm
            if(location.href.indexOf('uat-dm.') > -1) dom.innerText = dm
        })

        loop(getLogoTextDD, function (dom) {
            dom.innerText = dxp
        })
        
        //document.title = title
        
    }

    var loop_count = 0

    function loop(getdom, cb) {
        var dom = getdom()
        if (dom !== null && (dom.innerHTML || dom.length > 0)) {
            cb(dom)
            clearInterval(timer1)
            loop_count = 0
        } else {
            loop_count++
            if (loop_count >= 20) {
                clearInterval(timer1)
                loop_count = 0
                return
            }
            var timer1 = setInterval(function () {
                loop(getdom, cb)
                clearInterval(timer1)
            }, 500)
        }
    }


    window.addEventListener('hashchange', function () {
        console.log('The hash has changed!')
    });

    rpdeep()
    window.addEventListener('DOMContentLoaded', (evt) => {
        rpdeep()
        setTimeout(function () {
            $('.copyright').innerText = 'Copyright © 2020'
            $('.login-layout__card--form__footer').innerText = ''
            $('.login-layout__card--banner img').src = ''
            $('.login-layout__card--banner img').src = 'data:image/jpg;base64,'
            // $('.head .logo .logo-icon').style.visibility = 'hidden'

        }, 210)

    })

    var _wr = function (type) {
        var orig = history[type];
        return function () {
            var e = new Event(type);
            e.arguments = arguments;
            window.dispatchEvent(e);
            // 注意事件监听在url变更方法调用之前 也就是在事件监听的回调函数中获取的页面链接为跳转前的链接
            var rv = orig.apply(this, arguments);
            return rv;
        };
    };
    history.pushState = _wr('pushState');
    history.replaceState = _wr('replaceState');
    window.addEventListener('pushState', function (e) {
        var path = e && e.arguments.length > 2 && e.arguments[2];
        var url = /^http/.test(path) ? path : (location.protocol + '//' + location.host + path);
        console.log('old:' + location.href, 'new:' + url);
        rpdeep()

    });
    window.addEventListener('replaceState', function (e) {
        var path = e && e.arguments.length > 2 && e.arguments[2];
        var url = /^http/.test(path) ? path : (location.protocol + '//' + location.host + path);
        console.log('old:' + location.href, 'new:' + url);
        rpdeep()

    });
})();
